import React from "react";
import { Route } from "react-router-dom";
import Welcome from "./components/Welcome";
import Product from "./components/Product";

export default class App extends React.Component {
  render() {
    return (
      <div>
        <p>Hello, Hello!</p>

        <Route path="/welcome">
          <Welcome />
        </Route>
        <Route path="/products">
          <Product />
        </Route>
      </div>
    );
  }
}
